import React from 'react'
import Header from '../headers'
import './hero.scss'

const Hero = () => {
    return (
        <div className="LandingHero">        
            <Header/>
            <h1 className="LandingHero_title">Películas y series ilimitadas y mucho más.</h1>
            <h3 className="LandingHero_subtitle">Disfruta donde quieras. Cancela cuando quieras.</h3>
            <h6 className="LandingHero_text">¿Quieres ver Netflix ya? Ingresa tu email para crear una cuenta o reiniciar tu membresía de Netflix.</h6>
        </div>
    )
}

export default Hero;
